import React, { useState, useRef, useEffect } from 'react';

const PropertySlider = () => {
  const [currentIndex, setCurrentIndex] = useState(0);
  const sliderRef = useRef(null);
  
  // Sample property data - replace with your actual data
  const properties = [
    {
      id: 1,
      title: "Modern Apartment",
      location: "Downtown",
      price: "$1,200/month",
      image: "/api/placeholder/400/300"
    },
    {
      id: 2,
      title: "Luxury Villa",
      location: "Beachfront",
      price: "$2,500/month",
      image: "/api/placeholder/400/300"
    },
    {
      id: 3,
      title: "Cozy Studio",
      location: "City Center",
      price: "$850/month",
      image: "/api/placeholder/400/300"
    },
    {
      id: 4,
      title: "Family House",
      location: "Suburbs",
      price: "$1,800/month",
      image: "/api/placeholder/400/300"
    }
  ];

  // Handle navigation
  const goToPrevious = () => {
    const isFirstSlide = currentIndex === 0;
    const newIndex = isFirstSlide ? properties.length - 1 : currentIndex - 1;
    setCurrentIndex(newIndex);
  };

  const goToNext = () => {
    const isLastSlide = currentIndex === properties.length - 1;
    const newIndex = isLastSlide ? 0 : currentIndex + 1;
    setCurrentIndex(newIndex);
  };

  // Effect to smoothly scroll to the current slide
  useEffect(() => {
    if (sliderRef.current) {
      const scrollAmount = currentIndex * (sliderRef.current.offsetWidth / 2);
      sliderRef.current.scrollTo({
        left: scrollAmount,
        behavior: 'smooth'
      });
    }
  }, [currentIndex]);

  return (
    <div className="relative max-w-4xl mx-auto">
      {/* Left Arrow */}
      <div 
        className="absolute left-2 top-1/2 transform -translate-y-1/2 bg-white/70 rounded-full p-2 cursor-pointer z-10 shadow-md hover:bg-white transition-colors"
        onClick={goToPrevious}
      >
        <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 text-gray-800" fill="none" viewBox="0 0 24 24" stroke="currentColor">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 19l-7-7 7-7" />
        </svg>
      </div>

      {/* Right Arrow */}
      <div 
        className="absolute right-2 top-1/2 transform -translate-y-1/2 bg-white/70 rounded-full p-2 cursor-pointer z-10 shadow-md hover:bg-white transition-colors"
        onClick={goToNext}
      >
        <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 text-gray-800" fill="none" viewBox="0 0 24 24" stroke="currentColor">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
        </svg>
      </div>

      {/* Slider container */}
      <div 
        ref={sliderRef}
        className="flex overflow-x-auto snap-x snap-mandatory scrollbar-hide"
        style={{ scrollbarWidth: 'none', msOverflowStyle: 'none' }}
      >
        {properties.map((property, index) => (
          <div 
            key={property.id}
            className="flex-shrink-0 w-1/2 p-4 snap-start"
          >
            <div className="bg-white rounded-lg shadow-lg overflow-hidden">
              <img 
                src={property.image} 
                alt={property.title} 
                className="w-full h-48 object-cover"
              />
              <div className="p-4">
                <h3 className="text-lg font-semibold">{property.title}</h3>
                <p className="text-gray-600">{property.location}</p>
                <p className="text-blue-600 font-bold mt-2">{property.price}</p>
              </div>
            </div>
          </div>
        ))}

        {/* View More Button as the last slide */}
        <div className="flex-shrink-0 w-1/2 p-4 snap-start flex items-center justify-center">
          <button 
            className="bg-blue-600 hover:bg-blue-700 text-white px-6 py-3 rounded-lg font-medium shadow-md transition-colors"
            onClick={() => console.log("View More clicked")}
          >
            View More
          </button>
        </div>
      </div>

      {/* Optional: Add pagination dots */}
      <div className="flex justify-center mt-4">
        {properties.map((_, index) => (
          <div
            key={index}
            className={`w-2 h-2 mx-1 rounded-full ${
              currentIndex === index ? 'bg-blue-600' : 'bg-gray-300'
            }`}
          />
        ))}
        {/* Extra dot for the View More button */}
        <div
          className={`w-2 h-2 mx-1 rounded-full ${
            currentIndex === properties.length ? 'bg-blue-600' : 'bg-gray-300'
          }`}
        />
      </div>
    </div>
  );
};

export default PropertySlider;
